import "./App.css";
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom'
import Home from './pages'

function App() {


  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path = "/"/> {/* The "/" means this is route for the main entry point of website */}
        </Routes>

      </Router>
    </div>
  );
}

export default App;
